Given the following program, identify all redundant data types (e.g., a data type defined by the programmer via typedef). Please write the identified data type into a list: [a list of identifiers]. If no data type is identified, just give an empty list [].. The program is struct c {
  int d : 18;
  int g;
};
struct c i;
int main() {
  struct c l;
  l.d = i.d;
  int n = i.d && l.d;
  int p = l.d | -(l.d && l.d) - n;
  i.g = p;
}
